    const addNumsToBodyLines = (num) => {
        const bodyLinesArray = []
        for (let i = 1; i < num; i++) {
            bodyLinesArray.push(eval('bLine' + i + '.current'))
        }
        return bodyLinesArray
    }
    const randomNum = () => {
        const min = Math.ceil(0)
        const max = Math.floor(1)
        return Math.floor(Math.random() * (max - min + 1) + min) //The maximum is inclusive and the minimum is inclusive
    }

